INSERT INTO `pregunta` VALUES (1,'Explica de manera clara los contenidos de la asignatura',1),(2,'Relaciona los contenidos de la asignatura con los contenidos de otras.',1),(3,'Resuelve las dudas relacionadas con los contenidos de la asignatura.',1),(4,'Propone ejemplos o ejercicios que vinculan la asignatura con la práctica profesional.',1),(5,'Explica la utilidad de los contenidos teóricos y prácticos para la actividad profesional.',1),(6,'Cumple con los acuerdos establecidos al inicio de la asignatura.',2),(7,'Durante el curso establece las estrategias adecuadas necesarias para lograr el aprendizaje deseado.',2),(8,'El programa presentado al principio de la asignatura se cubre totalmente.',2),(9,'Incluye experiencias de aprendizaje en lugares diferentes al aula (talleres, laboratorios, empresas, comunidad, etc.).',3),(10,'Utiliza para el aprendizaje las herramientas de interacción de las tecnologías actuales de la información (correo electrénico, chats, plataformas, etc.)',3),(11,'Organiza actividades que me permiten ejercitar mi expresion oral y escrita.',3),(12,'Relaciona los contenidos de la asignatura con la industria y la sociedad a nivel local, regional, nacional e internacional.',3),(13,'Usa ejemplos y casos relacionados con la vida real.',3),(14,'Adapta las actividades para atender los diferentes estilos de aprendizaje de los estudiantes.',4),(15,'Promueve el autodidactismo y la investigación.',4),(16,'Promueve actividades participativas que me permiten colaborar con mis compañeros con una actividad positiva',4),(17,'Estimula la reflexión sobre la manera en que aprendes.',4),(18,'Se involucra en las actividades propuestas al grupo.',4),(19,'Presenta y expone las clases de manera organizada y estructurada.',4),(20,'Utiliza diversas estrategias, métodos, medios y materiales.',4),(21,'Muestra compromiso y entusiasmo en sus actividades docentes.',5),(22,'Toma en cuenta las necesidades, intereses y expectativas del grupo.',5),(23,'Propicia el desarrollo de un ambiente de respeto y confianza.',5),(24,'Propicia la curiosidad y el deseo de aprender.',5),(25,'Reconoce los éxitos y logros en las actividades de aprendizaje.',5),(26,'Existe la impresión de que se toman represalias con algunos estudiantes.',5),(27,'Hace interesante la asignatura.',5),(28,'Identifica los conocimientos y habilidades de los estudiantes al inicio de la asignatura o de cada unidad.',6),(29,'Proporciona información para realizar adecuadamente las actividades de evaluación.',6),(30,'Toma en cuenta las actividades realizadas y los productos como evidencias para la calificación y acreditación de la asignatura.',6),(31,'Considera los resultados de la evaluación (asesorías, trabajos complementarios, búsqueda de información, etc.) para realizar mejoras en el aprendizaje.',6),(32,'Da a conocer las calificaciones en el plazo establecido.',6),(33,'Da oportunidad de mejorar los resultados de la evaluación del aprendizaje.',6),(34,'Muestra apertura para la corrección de errores de apreciación y evaluación.',6),(35,'Otorga calificaciones imparciales',6),(36,'Desarrolla la clase en un clima de apertura y entendimiento.',7),(37,'Escucha y toma en cuenta las opiniones de los estudiantes.',7),(38,'Muestra congruencia entre lo que dice y lo que hace.',7),(39,'Asiste a clases regular y puntualmente.',8),(40,'Fomenta la importancia de contribuir a la conservación del medio ambiente.',8),(41,'Promueve mantener limpias y ordenadas las instalaciones.',8),(42,'Es accesible y está dispuesto a brindarte ayuda académica.',8),(43,'Emplea las tecnologías de la información y de la comunicación como un medio que facilite el aprendizaje de los estudiantes.',9),(44,'Promueve el uso de diversas herramientas, particularmente las digitales, para gestionar (recabar, procesar, evaluar y usar) información.',9),(45,'Promueve el uso seguro, legal y ético de la información digital.',9),(46,'En general, pienso que es un buen docente.',10),(47,'Estoy satisfecha o satisfecho por mi nivel de desempeño y aprendizaje logrado gracias a la labor del docente.',10),(48,'Yo recomendaría a este docente a otros compañeros.',10);
